import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faFacebook,
  faGithub,
  faInstagram,
  faLinkedin,
  faYoutube,
} from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import "./Landing.css";



function Landing() {

    useEffect(() => {
        AOS.init({
          duration : 2000
        });
      }, []);
    return (
        <div
        id="landingPage"
        className="container d-flex flex-row justify-content-center justify-content-md-start align-items-center w-100 h-100"
        >
        <div className="row w-100">
            <div className="col-12 col-md-6">
            <h1 className="mainTitle text-white text-md-start text-center my-2" data-aos="fade-up">
                Achyut Neupane
            </h1>
            </div>
            <div class="col-12">
            <div className="d-flex flex-row justify-content-center justify-content-md-start text-white gap-2">
                <a href="https://www.linkedin.com/in/achyutkneupane/" rel="noreferrer" target="_blank">
                    <FontAwesomeIcon
                    icon={faLinkedin}
                    size="2x"
                    style={{ color: "#ffffff" }}
                    />
                </a>
                <FontAwesomeIcon
                icon={faGithub}
                size="2x"
                style={{ color: "#ffffff" }}
                />
                <FontAwesomeIcon
                icon={faFacebook}
                size="2x"
                style={{ color: "#ffffff" }}
                />
                <FontAwesomeIcon
                icon={faInstagram}
                size="2x"
                style={{ color: "#ffffff" }}
                />
                <FontAwesomeIcon
                icon={faYoutube}
                size="2x"
                style={{ color: "#ffffff" }}
                />
                <FontAwesomeIcon
                icon={faEnvelope}
                size="2x"
                style={{ color: "#ffffff" }}
                />
            </div>
            </div>
        </div>
        </div>
  );
}

export default Landing;
